import Todos from './components/Todos';  
import './App.css';

class App extends Component {
  state = {
    todos: [
      {
        title: 'Check your email',
        completed: false
      }
    ]
  }
  render () {
      return(
    <div className="App">
     <Todos />
    </div>
  );
}
}
export default App;
